import React from "react";
import ReactDOM from "react-dom";
import App from "./App";

//ReactDOM.render() is the functon that actually does the creating and updating of the DOM.  It's what connect React and the DOM.
//Render accepts two arguments, 1)the React element or javascript object that describes the element you would like to render and 2)The actual HTML element you would like to render to.
ReactDOM.render(
	<React.StrictMode>
		<App />
	</React.StrictMode>,
	document.getElementById("root")
	//With document.getElementById("root") we are targeting the DOM element with the ID root.
);

//It's not until render() that react creates actual DOM elements.
